import React, { useState, useRef, useEffect } from "react";
import { motion } from "framer-motion";

export default function Account({setLogin}) {
    const [signUp, setSignUp] = useState(false);
    const [accountForm, setAccountForm] = useState(false);
    let popUpRef = useRef();

    useEffect(() => {
        let handler = e => {
            if(!popUpRef.current.contains(e.target)) {
                setLogin(false);
            }
        }

        document.addEventListener('mousedown', handler);

        return () => {
            document.removeEventListener('mousedown', handler);
        }
    })

    function handleSignUp(e) {
        e.preventDefault();
        setAccountForm(true);
        console.log('submited')
    }

    function handleLogin(e) {
        e.preventDefault();
    }

    return (
        <div className="account">
            {accountForm ? 
            <motion.form initial={{ opacity: 0, y: 10 }} 
            whileInView={{ opacity: 1, y: 0}} 
            transition={{ duration: .8, delay: .3 }} 
            viewport={{ once: true }}
            style={{width: "650px"}}>
                <h1><span className="add-line-break">COMPLETE</span> YOUR INFORMATION.</h1>
                <div className="input-flex-container">
                    <div className="user-input">
                        <p>First Name</p>
                        <input type="text" placeholder="Enter First Name" />
                    </div>

                    <div className="user-input">
                        <p>Last Name</p>
                        <input type="password" placeholder="Enter Last Name" />
                    </div>
                </div>

                <div className="input-flex-container">
                    <div className="user-input">
                        <p>Email</p>
                        <input type="text" placeholder="Enter Email" />
                    </div>

                    <div className="input-flex-container">
                        <div className="user-input">
                            <p>Age</p>
                            <input type="text" />
                        </div>

                        <div className="user-input">
                            <p>Gender</p>
                            <input type="text" />
                        </div>
                    </div>
                </div>

                <div className="buttons-container">
                    <button className="button" type="submit" style={{textAlign: "center"}}>
                        <p>CONFIRM</p>
                    </button>
                </div>
            </motion.form> 
            :
            signUp ? 
            <motion.form onSubmit={handleSignUp}
            initial={{ opacity: 0, y: 10 }} 
            whileInView={{ opacity: 1, y: 0}} 
            transition={{ duration: .8, delay: .3 }} 
            viewport={{ once: true }}>
                <h1><span className="add-line-break">CREATE</span> YOUR ACCOUNT.</h1>
                <div className="user-input">
                    <p>User Name</p>
                    <input type="text" placeholder="Enter User Name" />
                </div>

                <div className="user-input">
                    <p>Password</p>
                    <input type="password" placeholder="Enter Password" />
                </div>

                <div className="user-input">
                    <p>Password Confirmation</p>
                    <input type="password" placeholder="Confirm Password" />
                </div>

                <div className="buttons-container flex-box">
                    <button className="button" type="submit">
                        <p>SIGN UP</p>
                    </button>
                    <div className="sign-up-link flex-box" onClick={() => setSignUp(false)}>
                        <p>GO BACK</p>
                        <div className="sign-up-arrow-container">
                            <img src="https://aster-imgs.s3.amazonaws.com/arrow-white.png" alt="arrow" />
                        </div>
                    </div>
                </div>
            </motion.form>
            : 
            <motion.form ref={popUpRef} onSubmit={handleLogin}
                initial={{ opacity: 0, y: 10 }} 
                whileInView={{ opacity: 1, y: 0}} 
                transition={{ duration: .6}} 
                viewport={{ once: true }}>
                <h1><span className="add-line-break">LOGIN TO</span> YOUR ACCOUNT.</h1>
                <div className="user-input">
                    <p>User Name</p>
                    <input type="text" placeholder="Enter User Name" />
                </div>

                <div className="user-input">
                    <p>Password</p>
                    <input type="password" placeholder="Enter Password" />
                </div>

                <div className="buttons-container flex-box">
                    <button className="button" type="submit">
                        <p>SIGN IN</p>
                    </button>
                    <div className="sign-up-link flex-box" onClick={() => setSignUp(true)}>
                        <p>SIGN UP</p>
                        <div className="sign-up-arrow-container">
                            <img src="https://aster-imgs.s3.amazonaws.com/arrow-white.png" alt="arrow" />
                        </div>
                    </div>
                </div>
            </motion.form>}
        </div>
    )
}
